import "./App.css";
import Nav from "./components/nav/nav";
import { AuthProvider } from "./context/AuthContext";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Recipes from "./pages/communities/recipes/recipes";
import Home from "./pages/home";
import Login from "./pages/user/login";
import Signup from "./pages/user/signup";
import PrivateRoute from "./utils/PrivateRoute";

function App() {
  return (
    <Router>
      <div className="App">
        <Nav />
        <Switch>
          <PrivateRoute exact path="/HowTo/">
            <Home></Home>
          </PrivateRoute>
          <PrivateRoute exact path="/HowTo/recipes">
            <Recipes></Recipes>
          </PrivateRoute>
          <Route exact path="/HowTo/login">
            <Login></Login>
          </Route>
          <Route exact path="/HowTo/signup">
            <Signup></Signup>
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
